import React from 'react';
import "./Main.scss";

const Main = () => {
    return (
        <div className='Main_container'>
            <div className='Main_title'>
                <div className='title'>REX</div>
                <div className='title'>AHN<br/> JAEHYUN</div>
            </div>
            <div className='Main_myLink'></div>
        </div>
    );
};

export default Main;
